import styled from "styled-components";


function Header() {

    const svgIconStyle = {
        fill : "white",
        background  : "red"
    }


    return (
    <div>
    <HeaderContainer>
        <HeaderSubContainer>PLAN R</HeaderSubContainer>
        <HeaderSubContainer>
            <SearchBar>Search</SearchBar>
        </HeaderSubContainer>
        <HeaderSubContainer>
            <PrimaryGlowingButton>Account</PrimaryGlowingButton>
            <PrimaryGlowingButton>Notify</PrimaryGlowingButton>
        </HeaderSubContainer>
    </HeaderContainer>
    </div>
  );
}

export default Header;
